import PropTypes from 'prop-types'

// material-ui
import { useTheme } from '@mui/material/styles'
import {
  Box,
  Drawer,
  useMediaQuery,
  Avatar,
  Chip,
  ListItemButton,
  ListItemIcon,
  ListItemText,
  Typography,
} from '@mui/material'

// third-party
import PerfectScrollbar from 'react-perfect-scrollbar'
import { BrowserView, MobileView } from 'react-device-detect'

// project imports
import MenuList from './MenuList'
import LogoSection from '../LogoSection'
import MenuCard from './MenuCard'

// icons import
import {
  IconDashboard,
  IconKey,
  IconBrandChrome,
  IconHelp,
  IconTypography,
  IconPalette,
  IconShadow,
  IconWindmill,
} from '@tabler/icons'

// constant
const icons = {
  IconDashboard,
  IconKey,
  IconBrandChrome,
  IconHelp,
  IconTypography,
  IconPalette,
  IconShadow,
  IconWindmill,
}

// ======================||Menu-Items||=============================================//
const menuItemlist = [
  {
    id: 'dashboard',
    // title: 'Dashboard',
    type: 'group',
    children: [
      {
        id: 'default',
        title: 'Dashboard',
        type: 'item',
        url: '/dashboard/default',
        icon: icons.IconDashboard,
        breadcrumbs: false,
      },
    ],
  },
  {
    id: 'pages',
    // title: 'Pages',
    // caption: 'Pages Caption',
    type: 'group',
    children: [
      {
        id: 'authentication',
        title: 'Authentication',
        type: 'collapse',
        icon: icons.IconKey,

        children: [
          {
            id: 'login3',
            title: 'Login',
            type: 'item',
            url: '/pages/login/login3',
            target: true,
          },
          {
            id: 'register3',
            title: 'Register',
            type: 'item',
            url: '/pages/register/register3',
            target: true,
          },
        ],
      },
    ],
  },
  {
    id: 'utilities',
    // title: 'Utilities',
    type: 'group',
    children: [
      {
        id: 'util-typography',
        title: 'Typography',
        type: 'item',
        url: '/utils/util-typography',
        icon: icons.IconTypography,
        breadcrumbs: false,
      },
      {
        id: 'util-color',
        title: 'Color',
        type: 'item',
        url: '/utils/util-color',
        icon: icons.IconPalette,
        breadcrumbs: false,
      },
      {
        id: 'util-shadow',
        title: 'Shadow',
        type: 'item',
        url: '/utils/util-shadow',
        icon: icons.IconShadow,
        breadcrumbs: false,
      },
      {
        id: 'icons',
        title: 'Icons',
        type: 'collapse',
        icon: icons.IconWindmill,
        children: [
          {
            id: 'tabler-icons',
            title: 'Tabler Icons',
            type: 'item',
            url: '/icons/tabler-icons',
            breadcrumbs: false,
          },
          {
            id: 'material-icons',
            title: 'Material Icons',
            type: 'item',
            url: '/icons/material-icons',
            breadcrumbs: false,
          },
        ],
      },
    ],
  },
  {
    id: 'sample-docs-roadmap',
    type: 'group',
    children: [
      {
        id: 'sample-page',
        title: 'Sample Page',
        type: 'item',
        url: '/sample-page',
        icon: icons.IconBrandChrome,
        breadcrumbs: false,
      },
      {
        id: 'documentation',
        title: 'Documentation',
        type: 'item',
        url: 'https://codedthemes.gitbook.io/berry/',
        icon: icons.IconHelp,
        external: true,
        target: true,
      },
    ],
  },
]

// ==============================|| SIDEBAR DRAWER ||============================== //

const Sidebar = ({ drawerOpen, drawerToggle, window }) => {
  const theme = useTheme()
  const matchUpMd = useMediaQuery(theme.breakpoints.up('md'))

  const drawer = (
    <>
      <Box sx={{ display: { xs: 'block', md: 'none' } }}>
        <Box sx={{ display: 'flex', p: 2, mx: 'auto' }}>
          <LogoSection />
        </Box>
      </Box>
      <BrowserView>
        <PerfectScrollbar
          component='div'
          style={{
            height: !matchUpMd ? 'calc(100vh - 56px)' : 'calc(100vh - 88px)',
            paddingLeft: '16px',
            paddingRight: '16px',
          }}
        >
          {/* <MenuList /> */}
          {/* sidebar items */}

          {/* <MenuCard /> */}
        </PerfectScrollbar>
      </BrowserView>
      <MobileView>
        <Box sx={{ px: 2 }}>
          <MenuList />
          <MenuCard />
        </Box>
      </MobileView>
    </>
  )

  const container =
    window !== undefined ? () => window.document.body : undefined

  return (
    <Box
      component='nav'
      sx={{ flexShrink: { md: 0 }, width: matchUpMd ? 260 : 'auto' }}
      aria-label='mailbox folders'
    >
      <Drawer
        container={container}
        variant={matchUpMd ? 'persistent' : 'temporary'}
        anchor='left'
        open={drawerOpen}
        onClose={drawerToggle}
        sx={{
          '& .MuiDrawer-paper': {
            width: 260,
            background: '#ffffff',
            color: theme.palette.text.primary,
            borderRight: 'none',
            [theme.breakpoints.up('md')]: {
              top: '88px',
            },
          },
        }}
        ModalProps={{ keepMounted: true }}
        color='inherit'
      >
        {drawer}
      </Drawer>
    </Box>
  )
}

Sidebar.propTypes = {
  drawerOpen: PropTypes.bool,
  drawerToggle: PropTypes.func,
  window: PropTypes.object,
}

export default Sidebar
